import Modal from 'components/Modal/Modal';
import React, { useState } from 'react';

const HomePage = () => {
  const [showModal, setShowModal] = useState(true);
  return (
    <div>
      HomePage
      {showModal && <Modal onClose={setShowModal}>Test modal</Modal>}
    </div>
  );
};

export default HomePage;
